// FIXME: stringからDate型に変換して日本時間に修正する
export const shapeDate = (date: string): string => {
  console.log(Date.parse(date).customFormat('#DD#/#MM#/#YYYY# #hh#:#mm#:#ss#'))
  return '2020'
}
